import React from "react";
import "./App.css";
import Header from "../src/components/header/Header";
import Form from "../src/components/Form/Form";
import StartupPage from "../src/components/StartupPage/StartupPage";
import Particles from "../src/components/Particle/ParticleComponent"
class App extends React.Component {
  constructor() {
    super();
    this.state = {
      showForm: false
    };
  }
  showFormHandler = () => {
    this.setState({
      showForm: !this.state.showForm
    });
  };
  render() {
    let displayElement = <StartupPage changed={this.showFormHandler} />;
    if (this.state.showForm) {
      displayElement = <Form />;
    } else {
      displayElement = <StartupPage changed={this.showFormHandler} />;
    }
    return (
      <React.Fragment>
        <Header />
        <div
        style={{
          position: "absolute",
          top: 0,
          left: 0,
          width: "100%",
          height: "100%"
        }}
      >
        <Particles />
        <div
          style={{
            position: "absolute",
            top: 0,
            left: 0,
            width: "100%",
            height: "100%"
          }}
        >

          {/* You can render <Route> and <NavTabs /> here */}
        </div>

      </div>

      {displayElement}
      </React.Fragment>
    );
  }
}

export default App;
